import React, { Component } from 'react';
import {Form, Input, Button, Radio, Icon} from 'antd';
import {Link} from "react-router-dom";
import Menus from "../Menus";

class ApplyForm extends Component {
    constructor() {
        super();
        this.state = {
            formLayout: 'horizontal',
        };
    }

    handleFormLayoutChange = e => {
        this.setState({ formLayout: e.target.value });
    };

    render() {
        const {formLayout} = this.state;
        const formItemLayout =
            formLayout === 'horizontal'
                ? {
                    labelCol: {span: 4},
                    wrapperCol: {span: 14},
                }
                : null;
        const buttonItemLayout =
            formLayout === 'horizontal'
                ? {
                    wrapperCol: {span: 14, offset: 4},
                }
                : null;
        return (
            <div className={"proContent"}>
                <span className={"bread"}>
                    <Link to="/Home"> 首页 </Link><Icon type="right" />
                    <Link to="/Problem">理赔中心</Link><Icon type="right" />常见问题
                </span>
                <div className={"proText"}>
                    <div className={"menus"}>
                        <Menus/>
                    </div>
                    <div>
                        <Form layout={formLayout}>
                            <Form.Item label="Form Layout" {...formItemLayout}>
                                <Radio.Group defaultValue="horizontal" onChange={this.handleFormLayoutChange}>
                                    <Radio.Button value="horizontal">Horizontal</Radio.Button>
                                    <Radio.Button value="vertical">Vertical</Radio.Button>
                                    <Radio.Button value="inline">Inline</Radio.Button>
                                </Radio.Group>
                            </Form.Item>
                            <Form.Item label="Field A" {...formItemLayout}>
                                <Input placeholder="input placeholder"/>
                            </Form.Item>
                            <Form.Item label="Field B" {...formItemLayout}>
                                <Input placeholder="input placeholder"/>
                            </Form.Item>
                            <Form.Item {...buttonItemLayout}>
                                <Button type="primary">Submit</Button>
                            </Form.Item>
                        </Form>
                    </div>
                </div>
            </div>
            )
        }
    }

export default ApplyForm;
